package com.Iasoftware.nomina.infrastructure.controllers.services.models;import com.Iasoftware.nomina.core.domain.Report;public class ReportDTO {    private String id;    private  String technicalIdentification;    private  String serviceIdentification;    private  String startDate;    private  String endDate;    public ReportDTO(String id, String technicalIdentification, String serviceIdentification, String startDate, String endDate) {        this.id = id;        this.technicalIdentification = technicalIdentification;        this.serviceIdentification = serviceIdentification;        this.startDate = startDate;        this.endDate = endDate;    }    public static ReportDTO fromDomain(Report report) {        return new ReportDTO(                report.getId().getValue(),                report.getIdTechnical().getValue(),                report.getIdService().getValue(),                report.getStartDate().toString(),                report.getEndDate().toString()        );    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getTechnicalIdentification() {        return technicalIdentification;    }    public void setTechnicalIdentification(String technicalIdentification) {        this.technicalIdentification = technicalIdentification;    }    public String getServiceIdentification() {        return serviceIdentification;    }    public void setServiceIdentification(String serviceIdentification) {        this.serviceIdentification = serviceIdentification;    }    public String getStartDate() {        return startDate;    }    public void setStartDate(String startDate) {        this.startDate = startDate;    }    public String getEndDate() {        return endDate;    }    public void setEndDate(String endDate) {        this.endDate = endDate;    }}